import React from "react";
import { Routes, Route } from "react-router-dom";
import Login from "../pages/Login";
import Home from "../pages/Home";

function AppRouters() {
    return(
        <Routes>
            <Route path="/" element={<Login />} />
            <Route path="/Home" element={<Home /> } />
        </Routes>
    );
}

export default AppRouters;
